import React from 'react';
import InstagramEmbed from 'react-instagram-embed';
import { makeStyles } from '@material-ui/core/styles';

import bgImage from 'assets/img/bg8.jpg'

const useStyles = makeStyles({
    container: {
        height: '100vh',
        backgroundImage:'linear-gradient(to bottom, transparent, rgba(0, 0, 0, 0.72)), url('+ bgImage +')',
        zIndex: '10'
    },
    outerInsta: {
        position: 'absolute',
        marginLeft: '5vw',
        marginTop: '20vh',
        width: '24vw',
        overflow: 'hidden',
    },
    instagram: {
        height: '65vh',
        width: '25vw',
        overflowY: 'scroll',
        paddingRight: '-10vw',
    },
    facebook: {
        position: 'absolute',
        marginLeft: '35vw',
        marginTop: '20vh',
        width: '10vw',
    },
    facebookback: {
        position: 'absolute',
        marginLeft: '35vw',
        marginTop: '20vh',
        height: '65vh',
        width: '10vw',
        zIndex: '100'
    },
    blog: {
        position: 'absolute',
        marginLeft: '65vw', 
        width: '25%', 
        marginTop: '35vh'
    }
});

export default function SectionSocial(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <div className={classes.outerInsta}>
                <div className={classes.instagram}>
                    <InstagramEmbed
                        url='https://www.instagram.com/p/BtTMxnYhSlZ/'
                        maxWidth={480}
                        hideCaption={false}
                        containerTagName='div'
                        protocol=''
                        injectScript
                        onLoading={() => { }}
                        onSuccess={() => { }}
                        onAfterRender={() => { }}
                        onFailure={() => { }}
                    />
                </div>
            </div>
            <div className={classes.facebook}>
                <iframe src="https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fsrmteamrudra%2Fposts%2F2406254082726962%3A0&width=500" width="500" height="548" style={{border:"none", overflow:"hidden"}} scrolling="no" frameborder="0" allowTransparency="true" allow="encrypted-media"></iframe>
            </div>
            <div className={classes.blog}>
                <blockquote class="embedly-card"><h4 style={{fontSize: '4vh', color: '#fff'}}><a href="https://medium.com/@srmmarsroverteam">Team Rudra - Medium</a></h4><p>Read writing from Team Rudra on Medium. RUDRA is an official robotics team of SRM Institute of Science and Technology that specializes in building mars rover prototypes.</p></blockquote>
            </div>
            <div className={classes.facebookback}></div>
        </div>
    );
}
